import React , {Component} from "react";
import goku from './../images/Goku.png'

class Goku extends Component{
    state= {
        hits: 0
    }
    
    render(){
        return(
            <div className="col">
                <img src={goku} alt="Goku"/><br/>
                <button className="btn btn-success m-3" onClick={this.addOne}>frappe</button>
                <table className="table table-striped">
                    <thead>
                        <tr>
                            <th>Count:</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td>Count : {this.state.hits}</td>
                        </tr>
                    </tbody>

                </table>
            </div>
        )
    }
}
export default Goku
